import style from "./Register.module.css"
import {useState} from 'react'

function Register(){
  const [secure, setSecure] = useState('white')

  const passHandler = (ev) => {
    const pass = ev.target.value
    if(pass.length < 4) {
      setSecure('red')
    }
    if(pass.length > 4 && pass.length < 8){
      setSecure('yellow')
    }
    if(pass.length > 8){
      setSecure('green')
    }

  }

  return (
    <div className={style.register}>

    <div className={style.signUp}>

      <h1>Register</h1>
      <input placeholder="Name"/>
      <input placeholder="Email"/>
      <input placeholder="Password" onChange={(ev) => passHandler(ev)} />
      <div className={style.passDiv} style={{backgroundColor: secure}} />
      <input placeholder="Password"/>

    </div>


    </div>
  )
}
export default Register
